var CheckConnection = function() {

    function valueOf(selector) {
        return jQuery(selector).val();
    }

    function _hookupCheckConnection(id, pipelineName, materialType, materialUrl, username, password, encryptedPassword, isChanged, projectPath, domain, view) {
        jQuery(id).click(function() {
            var isEncrypted = false;
            var finalPass = '';
            if (password) {
                if (encryptedPassword === "false" || jQuery(isChanged).is(':checked')) {
                    finalPass = valueOf(password);
                } else {
                    finalPass = valueOf(encryptedPassword);
                    isEncrypted = true;
                }
            }
            WizardPage.checkConnection(pipelineName, '/go/vcs.json', valueOf(username), finalPass, valueOf(materialUrl), materialType, isEncrypted, valueOf(projectPath), valueOf(domain), valueOf(view));
        });
    }

    return {
        hookupCheckConnection: _hookupCheckConnection
    }
};;
