function getMessage(key) {
    return i18n_messages[key.toLowerCase()];
}

function updateI18nStatus(elementId, key) {
    if(!key) key=$(elementId).innerHTML;
    var i18n_message = getMessage(key);
    if (i18n_message)
        $(elementId).update(i18n_message);
};
