            $j('.page_header').hide();
            preloader.hide();
            var unableToFind = '<div class="pagenotfound"><div class="biggest">:(</div><h3> '+data.error+'</h3><span>Go to <a href="/go/pipelines">Pipelines</a></span></div>';
